import { partsData } from "./partsData";
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useContext } from 'react';
import { UserContext } from '../UserContext';

function getToday() {
  const d = new Date();
  const pad = n => n.toString().padStart(2, '0');
  return `${d.getFullYear()}-${pad(d.getMonth()+1)}-${pad(d.getDate())} ${pad(d.getHours())}:${pad(d.getMinutes())}:${pad(d.getSeconds())}`;
}

function ShippingStats(props) {
  const { parts, setParts } = props;
  const navigate = useNavigate();
  // 已移除 useEffect 內的登入與身分檢查
  const today = getToday();
  const [quantities, setQuantities] = useState(Array(parts.length).fill(""));
  const { user } = useContext(UserContext);

  const handleQuantityChange = (idx, value) => {
    const newQuantities = [...quantities];
    newQuantities[idx] = value;
    setQuantities(newQuantities);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const newParts = parts.map((part, idx) => {
      const qty = parseInt(quantities[idx], 10) || 0;
      return {
        ...part,
        stock: part.stock - qty
      };
    });
    setParts(newParts);
    // 記帳
    const records = JSON.parse(localStorage.getItem('records') || '[]');
    parts.forEach((part, idx) => {
      const qty = parseInt(quantities[idx], 10) || 0;
      if (qty > 0) {
        records.push({
          company: user?.company || user?.username || '',
          partId: part.id,
          partName: part.name,
          quantity: qty,
          price: part.price,
          amount: qty * part.price,
          time: today
        });
      }
    });
    localStorage.setItem('records', JSON.stringify(records));
    alert('發送完成！');
  }

  return (
    <div style={{ textAlign: 'center', marginBottom: 16 }}>
      <img src="images/logo.png" alt="Logo" style={{ height: 150 }} />
      <div style={{ maxWidth: 600, margin: '0 auto', padding: 16 }}>
        <h2 style={{ textAlign: 'center' }}>銷售統計</h2>
        <div style={{ textAlign: 'center', marginBottom: 16, fontWeight: 'bold', fontSize: 28 }}>
          出貨日期：{today}
        </div>
        <form onSubmit={handleSubmit}>
          <table style={{ width: '100%', textAlign: 'center', verticalAlign: 'middle' }} className="center-table">
            <thead>
              <tr>
                <th>圖片</th>
                <th>品號</th>
                <th>售價</th>
                <th>出貨數量</th>
              </tr>
            </thead>
            <tbody>
              {parts.map((item, idx) => (
                <tr key={item.id}>
                  <td><img src={item.image} alt={item.name} style={{ width: 60, height: 60, objectFit: 'cover' }} /></td>
                  <td>{item.name}</td>
                  <td>{item.price}</td>
                  <td>
                    <input
                      type="number"
                      min="0"
                      value={quantities[idx]}
                      onChange={e => handleQuantityChange(idx, e.target.value)}
                      style={{ width: 60 }}
                    />
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
          <div style={{ textAlign: 'center', marginTop: 16 }}>
            <button type="submit" style={{ fontSize: 24, padding: '12px 32px' }}>送出</button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default ShippingStats;
